import React from 'react';

import Sidebar from '../Sidebar/Sidebar';
import Header from '../Header/Header';
import styles from './Dashboard.module.css';

function Dashboard() {
    return (
        <div className={styles.dashboard}>
            <Sidebar />
            <div>
                <Header />
            </div>
        </div>
    )
}

export default Dashboard;
